import React from "react";
import MainContainer from "../../Layout/MainContainer";

const Category = () => {
  return (
    <MainContainer>
      <h1 className=" text-lg font-bold mt-2 ml-2 mb-3">P Categories</h1>
      <div
        style={{ boxShadow: "rgba( 0,0,0,0.24) 0px 3px 8px" }}
        className="w-full p-2 grid grid-cols-3 grid-rows-[auto] gap-5"
      >
        <CategoryItem />
        <CategoryItem />
        <CategoryItem />
        <CategoryItem />
        <CategoryItem />
        <CategoryItem />
      </div>
    </MainContainer>
  );
};

export default Category;

const CategoryItem = () => {
  return (
    <div className="w-full rounded-md flex flex-col items-center">
      <img
        src="https://lovelymeregis.co.uk/thumbs/Images/gallery/DSC_2474.jpg"
        alt="category item"
      />
      <h2> Category name</h2>
    </div>
  );
};
